Get constraint rules for multiple products at once by passing in an array of ids for the products you wish to have returned. Query parameters can be used to create more specific criteria for what is returned.

## Request ##
> Request body should be an array of objects containing a key with the name 'Id' and the string value for the id of the product to get constraint rules for.

#### Example ####
  [
      {
          "Id" : "a1C4R0000062IC0UAM"
      },
      {
          "Id" : "a1C4R0000062IC1UAM"
      },
      {
          "Id" : "a1C4R0000062IC2UAM"
      }
  ]

You can easily remove items from the Cart. The response will contain the delete status of each item deleted.

## Request ##
Request body should be an array of objects containing a key with the name 'Id' and the string value for the id of the cart item to delete.

